using CodeChallenge;
using CodeChallenge.LeetCode;

var leetCode = new LeetCode();
Log.Should(leetCode.IsSubsequence("abc", "ahbgdc").ToString(), "true");
Log.Should(leetCode.IsSubsequence("axc", "ahbgdc").ToString(), "false");
Log.Should(leetCode.IsSubsequence("", "").ToString(), "true");
Log.Should(leetCode.IsSubsequence("", "ahbgdc").ToString(), "true");
Log.Should(leetCode.IsSubsequence("abc", "acb").ToString(), "false");
Log.Should(leetCode.IsSubsequence("ab", "baab").ToString(), "true");
Log.Should(leetCode.IsSubsequence("leeeeetcode", "").ToString(), "true");

leetCode.MergeTwoLists(new ListNode(new int[] { 1, 2, 4 }), new ListNode(new int[] { 1, 3, 4 }));

Log.Should(leetCode.TwoSum(new int[] { 2, 7, 11, 15 }, 9), "[0, 1]");
Log.Should(leetCode.TwoSum(new int[] { 3, 2, 4 }, 6), "[1, 2]");
Log.Should(leetCode.TwoSum(new int[] { 3, 3 }, 6), "[0, 1]");

Log.Wait();